import CardCovid from "../Card";
import styles from "./CardGlobal.module.css";
import data from "../../../utils/constants/provinces";

function Global() {
   const global = data.indonesia;
  return (
    <div className={styles.container}>
      <section className={styles.pasiens}>
        <h2 className={styles.pasien__judul}>Indonesia</h2>
        <h3 className={styles.pasien__subjudul}>Data Covid Berdasarkan indonesia</h3>
        <div className={styles.pasien__container}>
          {global.map(function (cardcovid, key) {
            return <CardCovid cardcovid={cardcovid} key={key} />
          })};
        </div>
      </section>
    </div>
  );
}

export default Global;
